import { useEffect } from 'react';
import Head from 'next/head';

import { getInitialLocale } from '../config/i18n/getInitialLocale';

const App = () => {
  console.log(123);
  useEffect(() => {
    console.log(getInitialLocale());
    window.location.replace(`/${getInitialLocale() === 'en' ? '' : getInitialLocale()}`);
  }, []);
  return (
    <div>
      <Head>
        <link rel="icon" href="/favicon.ico" />
      </Head>
    </div>
  );
};

export default App;
